import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import hello from './simple/Hello';


function app() {
  return (
        <Router>
            <Switch>
              <Route path="/simple/hello" component={hello} />

            </Switch>
        </Router>
  );
}

export default App;
